from oscar.apps.security.abstract_models import (
    AbstractSecurity, AbstractSecurityApplication, AbstractSecuritySet)
from oscar.core.loading import is_model_registered

__all__ = []

if not is_model_registered('security', 'SecuritySet'):
    class SecuritySet(AbstractSecuritySet):
        pass

    __all__.append('SecuritySet')


if not is_model_registered('security', 'Security'):
    class Security(AbstractSecurity):
        pass

    __all__.append('Security')


if not is_model_registered('Security', 'SecurityApplication'):
    class SecurityApplication(AbstractSecurityApplication):
        pass

    __all__.append('SecurityApplication')
